export interface ICache<TKey, TValue> {
    setCachedValue(key: TKey, value: TValue): any;
    getCachedValue(key: TKey): TValue;
    /**
     * Clear the cache
     */
    clear(): any;
    /**
     * Get size of the cache
     */
    size(): number;
    setEnableLogging(enabled: boolean): any;
    isLoggingEnabled(): any;
    /**
     * It enables or disables the cache
     * @param enabled
     */
    setEnable(enabled: boolean): any;
}
